import React from 'react';
import CardOut from "./CardOut";

const History = () => {
    return (
        <div className={'card-out-list'} style={{width:'100%'}}>
           <div className={'card'} style={{width:'100%', height:'fit-content'}}>
               <span className={'card-title'}>бОБРОВ нИКИТА</span>
               <span className={'date-out'}>13.Ю01.1111</span>
               <span className={'delete'}>удалить</span>
           </div>
        </div>
    );
};

export default History;
